import React, { useState } from "react";
import {
    ArrowCircleUpIcon,
    DocumentTextIcon,
    MailIcon,
} from "@heroicons/react/solid";
import { Github } from "react-bootstrap-icons";

const FooterChat = () => {
    const [message, setMessage] = useState(false);

    // console.log(message);
    const sendMessage = () => {
        console.log(message);
    };

    return (
        <footer className="w-screen">
            {/* <div className="w-1/2 inline-block h-4 md:h-10 relative md:w-1/6 pt-2.5">
                <div
                    className="flex flex-row justify-around items-end text-white "
                    // style={{ color: "#999999" }}
                >
                    <div
                        className="px-3 py-1 rounded-full "
                        style={{ background: "#999999" }}
                    >
                        <Github className="w-4 h-4 md:w-8 md:h-8 " />
                    </div>
                    <div
                        className="px-2 bg-black rounded-full "
                        style={{ background: "#999999" }}
                    >
                        <DocumentTextIcon className="w-4 h-4 md:w-10 md:h-10 " />
                    </div>
                    <div
                        className="px-2 bg-black rounded-full "
                        style={{ background: "#999999" }}
                    >
                        <MailIcon className="w-4 h-4 md:w-10 md:h-10" />
                    </div>
                </div>
            </div> */}
            <div className="w-1/12 inline-block -mb-2.5">
                <div
                    className="px-3 rounded-full text-white"
                    style={{ background: "#999999" }}
                >
                    <Github className="w-4 h-4 md:w-8 md:h-8 " />
                </div>
            </div>
            <div className="w-1/12 inline-block -mb-2.5">
                <div
                    className="px-3  rounded-full text-white"
                    style={{ background: "#999999" }}
                >
                    <DocumentTextIcon className="w-4 h-4 md:w-8 md:h-8 " />
                </div>
            </div>
            <div className="w-1/12 inline-block -mb-2.5">
                <div
                    className="px-3 rounded-full text-white"
                    style={{ background: "#999999" }}
                >
                    <MailIcon className="w-4 h-4 md:w-8 md:h-8" />
                </div>
            </div>

            <div
                className="py-2 relative mx-auto w-3/4 inline-block "
                style={{ color: "#C4C4C6" }}
            >
                <input
                    className="border-2 border-gray-300 bg-white h-10 px-5 pr-16 rounded-full text-sm focus:outline-none w-full "
                    type="text"
                    name="Send a Message"
                    placeholder="Send a Message"
                />
                <button
                    type="submit"
                    className="absolute right-0 top-0 mt-2.5 ml-3 "
                >
                    <ArrowCircleUpIcon
                        className="mr-1 w-9 h-9"
                        aria-hidden="true"
                        style={{
                            color: "#007AFF",
                        }}
                    />
                </button>
            </div>
        </footer>
    );
};

export default FooterChat;
